import React from 'react';
import { StyleSheet, Text, View, Button, Image} from 'react-native';
import {globalStyles} from '../styles/global';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import FitImage from 'react-native-fit-image';
import { SafeAreaView } from 'react-native-safe-area-context';




function locationMosgiel() {
    return (

      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Mosgiel</Text>
      </View>
    );
  }

  function locationDunedin() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>HideModal</Text>
      </View>
    );
  }
  const image = require('../assets/homebg.jpeg')
  const Tab = createMaterialTopTabNavigator();

  export default function App() {
    return (

      <NavigationContainer independent={true}>
           <View style={globalStyles.locationHeader}>


           </View>
        <Tab.Navigator>
          <Tab.Screen name="Mosgeil" component={locationMosgiel} />
          <Tab.Screen name="Dunedin" component={locationDunedin} />
        </Tab.Navigator>
      </NavigationContainer>

    );
  }
